import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading';
import Paragraph from './Paragraph';
import List from "./List";

ReactDOM.render(
  <>
  <Heading/>

   <Paragraph/>
   <ol>
     <li>Musaif</li>
     <li>Khan</li>
     <li>Manohar</li>

   </ol>
   </>,

  document.getElementById("root")
);
